private void addDiskStat(Map<String, Map<DiskOp, Double>> diskStats,
    String disk, DiskOp diskOp, double latency) {
  if (!diskStats.containsKey(disk)) {
    diskStats.put(disk, new HashMap<>());
  }
  diskStats.get(disk).put(diskOp, latency);
}
